In order to better serve users and provide more professional contract services, the new web version and APP version of the perpetual contract will be launched soon.
1. Before the official switch, we provide a dual-version contract system for you to use. At the same time, when the new contract is just launched, there may be many imperfections. If you find a bug or any suggestion, please submit it through the link:
2. At that time, the old contract system will stop accessing. Users of the old contract must close their positions in time and transfer their assets to the currency account before the corresponding time; if they fail to close and transfer out in time, the platform will be based on the market price at that time Automatic liquidation and settlement, and transfer of assets to currency accounts; unfilled orders will be automatically cancelled by the system.
3. You can freely switch between old and new contracts through the navigation top floating layer. After you click [Switch new/old version], you will switch simultaneously when you access contract transactions, contract assets, contract orders, and contract-related operation functions; please note that the old and new versions of the contract Data is not interoperable;
The affected functions include but are not limited to: contract broker, contract experience fee, contract documentary, contract contest;
4. Your contract assets need to be transferred to the currency account before being transferred to the contract account;

Through daily position adjst., the system makes profit increase and loss reduction of contract leverage positions in the bottom levels of ETF. This ensures that the user\'s ETF leverage ratio is consistent with the agreed ratio.
ETF is divided into two kinds: timed position adjst. and no timed position adjst., in which timed position adjst. refers that the platform will at the daily fixed time point execute position rebalancing management, used to ensure that ETFs are in the agreed multiple leverage at the beginning of the day;
A no timed position adjst. refers to a temporary position adjst. when the actual leverage multiple of an ETF exceeds a certain level within a day, and the position is the agreed multiple leverage after the position adjst.
